import React from 'react';
import styled from 'styled-components';

const Header = () => {
    return (
        <WrapperLeftHeader>
            <div className="title">
                <span className="left__header__title">Gun's Portfolio</span>
            </div>
        </WrapperLeftHeader>
    );
};

export default Header;

const WrapperLeftHeader = styled.div`
    width: 208px;
    height: 30px;
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
`;
